import React from "react";
import "./App.css";
import Nav from "../nav";
import Footer from "../footer";
import HomePage from "../home-page";
import ContactUsPage from "../contact-us-page";
import AboutUsPage from "../about-us-page";

export default function App() {
  return (
    <div className="App">
      <Nav />
      {/* <HomePage /> */}
      <AboutUsPage />
      {/* <ContactUsPage /> */}
      <Footer />
    </div>
  );
}
